INSERT INTO `com_versiones_db` VALUES (1,'2016-02-13 14:46:07','CREATE TABLE IF NOT EXISTS `presupuestos` (\n  `id` int(11) NOT NULL AUTO_INCREMENT,\n  `id_empresa` int(11) NOT NULL,\n  `id_vendedor` int(11) NOT NULL,\n  `fecha` date NOT NULL,\n  `hora` time NOT NULL,\n  `fecha_hasta` date NOT NULL,\n  `id_usuario` int(11) NOT NULL,\n  `numero` int(11) NOT NULL,\n  `id_cliente` int(11) NOT NULL,\n  `subtotal` decimal(10,2) NOT NULL,\n  `comision_vendedor` decimal(10,2) NOT NULL,\n  `porc_descuento` decimal(5,2) NOT NULL,\n  `descuento` decimal(10,2) NOT NULL,\n  `total` decimal(10,2) NOT NULL,\n  `observaciones` text NOT NULL,\n  PRIMARY KEY (`id`),\n  KEY `id_cliente` (`id_cliente`),\n  KEY `id_vendedor` (`id_vendedor`),\n  KEY `id_empresa` (`id_empresa`)\n) ENGINE=InnoDB  DEFAULT CHARSET=latin1 AUTO_INCREMENT=1 ;\n\nCREATE TABLE IF NOT EXISTS `presupuestos_items` (\n  `id` int(11) NOT NULL AUTO_INCREMENT,\n  `id_empresa` int(11) NOT NULL,\n  `id_presupuesto` int(11) NOT NULL,\n  `id_articulo` int(11) NOT NULL,\n  `cantidad` decimal(10,3) NOT NULL,\n  `precio` decimal(10,2) NOT NULL,\n  `nombre` varchar(255) NOT NULL,\n  `orden` int(11) NOT NULL,\n  `bonificacion` decimal(5,2) NOT NULL,\n  `descripcion` TEXT NOT NULL,\n  `total` decimal(10,2) NOT NULL,\n  PRIMARY KEY (`id`,`id_empresa`),\n  KEY `id_presupuesto` (`id_presupuesto`)\n) ENGINE=InnoDB  DEFAULT CHARSET=latin1 AUTO_INCREMENT=1 ;\n\nINSERT INTO `com_modulos` (`id`, `dir`, `nombre`, `modulo_padre`, `etiqueta`, `orden`, `tiene_pantalla`, `clase`, `superadmin`, `valor`) VALUES (\'261\', \'\', \'presupuestos\', \'2\', \'Presupuestos\', \'2\', \'1\', \'\', \'\', \'\');\nALTER TABLE `com_usuarios` ADD `admin` BOOLEAN NOT NULL ;\nALTER TABLE `empresas` ADD `asignado_a` INT NOT NULL AFTER `id_web_template`, ADD INDEX (`asignado_a`) ;\n\nALTER TABLE `facturas` ADD `punto_venta` INT NOT NULL AFTER `id_usuario`;\n\nALTER TABLE `fact_configuracion` ADD `cotizacion_dolar` DECIMAL(10,2) NOT NULL AFTER `observaciones`;\n\nDROP TABLE `web_redes_sociales`;\n\nUPDATE com_configuracion SET version_db = 1 WHERE id = 1;','',1),(2,'2016-02-19 14:20:00','ALTER TABLE `facturas` ADD `visto` BOOLEAN NOT NULL ;\nALTER TABLE `empresas` ADD `logo` VARCHAR(255) NOT NULL ;\nALTER TABLE `fact_configuracion` ADD `facturacion_mostrar_logo_en_comprobante` BOOLEAN NOT NULL ;\nUPDATE com_configuracion SET version_db = 2 WHERE id = 1;','',1),(3,'2016-02-19 22:49:20','CREATE TABLE IF NOT EXISTS `not_categorias` (\n  `id` int(11) NOT NULL AUTO_INCREMENT,\n  `id_empresa` int(11) NOT NULL,\n  `nombre` varchar(255) CHARACTER SET latin1 DEFAULT NULL,\n  `id_padre` int(11) NOT NULL,\n  `link` varchar(255) COLLATE latin1_spanish_ci NOT NULL,\n  `orden` int(11) NOT NULL,\n  `activo` tinyint(1) NOT NULL,\n  `path` varchar(255) CHARACTER SET latin1 DEFAULT NULL,\n  `comentarios_activo` tinyint(1) NOT NULL,\n  PRIMARY KEY (`id`,`id_empresa`),\n  KEY `id_padre` (`id_padre`)\n) ENGINE=MyISAM  DEFAULT CHARSET=latin1 COLLATE=latin1_spanish_ci AUTO_INCREMENT=1 ;\n\n\nCREATE TABLE IF NOT EXISTS `not_categorias_relacionadas` (\n  `id` int(11) NOT NULL AUTO_INCREMENT,\n  `id_categoria` int(11) NOT NULL,\n  `id_relacion` int(11) NOT NULL,\n  `orden` int(11) NOT NULL,\n  PRIMARY KEY (`id`),\n  KEY `id_categoria` (`id_categoria`,`id_relacion`)\n) ENGINE=InnoDB  DEFAULT CHARSET=latin1 AUTO_INCREMENT=1 ;\n\n\nCREATE TABLE IF NOT EXISTS `not_entradas` (\n  `id` int(11) NOT NULL AUTO_INCREMENT,\n  `id_empresa` int(11) NOT NULL,\n  `id_idioma` int(11) NOT NULL,\n  `titulo` text NOT NULL,\n  `subtitulo` text NOT NULL,\n  `antetitulo` text NOT NULL,\n  `descripcion` text NOT NULL,\n  `texto` text NOT NULL,\n  `id_categoria` int(11) NOT NULL,\n  `fecha` datetime NOT NULL,\n  `activo` tinyint(1) NOT NULL,\n  `activo_desde` datetime NOT NULL,\n  `activo_hasta` datetime NOT NULL,\n  `destacado` tinyint(1) NOT NULL,\n  `destacado_desde` datetime NOT NULL,\n  `destacado_hasta` datetime NOT NULL,\n  `id_usuario` int(11) NOT NULL,\n  `publica_firma` tinyint(1) NOT NULL,\n  `comentarios_sistema` smallint(6) NOT NULL,\n  `comentarios_activo` tinyint(1) NOT NULL,\n  `path` varchar(255) NOT NULL,\n  `video` varchar(255) NOT NULL,\n  `seo_title` varchar(255) NOT NULL,\n  `seo_keywords` varchar(255) NOT NULL,\n  `seo_description` text NOT NULL,\n  `nivel_importancia` smallint(6) NOT NULL,\n  `vistos` int(11) NOT NULL,\n  `relacionados_tipo` char(1) NOT NULL,\n  `relacionados_cantidad` int(11) NOT NULL,\n  `link` varchar(255) NOT NULL,\n  PRIMARY KEY (`id`),\n  KEY `id_empresa` (`id_empresa`,`id_idioma`,`id_categoria`,`id_usuario`)\n) ENGINE=InnoDB  DEFAULT CHARSET=latin1 AUTO_INCREMENT=1 ;\n\n\nCREATE TABLE IF NOT EXISTS `not_entradas_comentarios` (\n  `id` int(11) NOT NULL AUTO_INCREMENT,\n  `id_empresa` int(11) NOT NULL,\n  `id_entrada` int(11) NOT NULL,\n  `id_usuario` int(11) NOT NULL,\n  `fecha` datetime NOT NULL,\n  `texto` text NOT NULL,\n  `orden` int(11) NOT NULL,\n  `destacado` tinyint(1) NOT NULL,\n  `estado` tinyint(4) NOT NULL,\n  `id_respuesta` int(11) NOT NULL,\n  PRIMARY KEY (`id`),\n  KEY `id_empresa` (`id_empresa`,`id_entrada`,`id_usuario`,`id_respuesta`)\n) ENGINE=InnoDB DEFAULT CHARSET=latin1 AUTO_INCREMENT=1 ;\n\n\nCREATE TABLE IF NOT EXISTS `not_entradas_etiquetas` (\n  `id` int(11) NOT NULL AUTO_INCREMENT,\n  `id_entrada` int(11) NOT NULL,\n  `id_etiqueta` int(11) NOT NULL,\n  `id_empresa` int(11) NOT NULL,\n  `orden` int(11) NOT NULL,\n  PRIMARY KEY (`id`),\n  KEY `id_entrada` (`id_entrada`,`id_etiqueta`,`id_empresa`)\n) ENGINE=InnoDB DEFAULT CHARSET=latin1 AUTO_INCREMENT=1 ;\n\nCREATE TABLE IF NOT EXISTS `not_entradas_images` (\n  `id` int(11) NOT NULL AUTO_INCREMENT,\n  `id_empresa` int(11) NOT NULL,\n  `id_entrada` int(11) NOT NULL,\n  `path` varchar(255) NOT NULL,\n  `texto` text NOT NULL,\n  `orden` int(11) NOT NULL,\n  PRIMARY KEY (`id`),\n  KEY `id_entrada` (`id_entrada`)\n) ENGINE=MyISAM DEFAULT CHARSET=latin1 AUTO_INCREMENT=1 ;\n\nCREATE TABLE IF NOT EXISTS `not_entradas_rela