 NULL,\n  `tipo` int(11) NOT NULL,\n  `id_objeto` int(11) NOT NULL,\n  `path` varchar(255) NOT NULL,\n  `nombre` varchar(255) NOT NULL,\n  PRIMARY KEY (`id`),\n  KEY `id_empresa` (`id_empresa`,`id_email`,`id_objeto`)\n) ENGINE=InnoDB  DEFAULT CHARSET=latin1 AUTO_INCREMENT=1 ;\n\nCREATE TABLE IF NOT EXISTS `crm_eventos` (\n  `id` int(11) NOT NULL AUTO_INCREMENT,\n  `id_empresa` int(11) NOT NULL,\n  `nombre` varchar(255) NOT NULL,\n  `id_tipo_evento` int(11) NOT NULL,\n  `fecha_inicio` datetime NOT NULL,\n  `fecha_fin` datetime NOT NULL,\n  `id_usuario` int(11) NOT NULL,\n  `id_propiedad` int(11) NOT NULL,\n  `id_contacto` int(11) NOT NULL,\n  `lugar` varchar(255) NOT NULL,\n  `recordar_cantidad` int(11) NOT NULL,\n  `recordar_tipo` char(1) NOT NULL,\n  `observaciones` text NOT NULL,\n  PRIMARY KEY (`id`),\n  KEY `id_empresa` (`id_empresa`,`id_tipo_evento`,`id_usuario`,`id_propiedad`,`id_contacto`)\n) ENGINE=InnoDB DEFAULT CHARSET=latin1 AUTO_INCREMENT=1 ;\n\nCREATE TABLE IF NOT EXISTS `crm_tareas` (\n  `id` int(11) NOT NULL AUTO_INCREMENT,\n  `id_empresa` int(11) NOT NULL,\n  `nombre` varchar(255) NOT NULL,\n  `realizada` tinyint(1) NOT NULL,\n  `fecha_vencimiento` datetime NOT NULL,\n  `id_usuario` int(11) NOT NULL,\n  `id_contacto` int(11) NOT NULL,\n  `id_propiedad` int(11) NOT NULL,\n  `recordar_cantidad` int(11) NOT NULL,\n  `recordar_tipo` char(1) NOT NULL,\n  `observaciones` text NOT NULL,\n  PRIMARY KEY (`id`),\n  KEY `id_empresa` (`id_empresa`,`id_usuario`,`id_contacto`,`id_propiedad`)\n) ENGINE=InnoDB DEFAULT CHARSET=latin1 AUTO_INCREMENT=1 ;\n\nALTER TABLE  `com_configuracion` ADD  `debug` BOOLEAN NOT NULL ;\nALTER TABLE `empresas` ADD `fecha_vencimiento` DATE NOT NULL AFTER `fecha_alta` ;\nALTER TABLE `facturas` ADD `enviada` BOOLEAN NOT NULL AFTER `cotizacion_dolar` ;\nALTER TABLE `presupuestos` ADD `enviado` BOOLEAN NOT NULL ,\nADD `visto` BOOLEAN NOT NULL ;\n\nALTER TABLE `fact_configuracion` ADD `facturacion_texto_email` TEXT NOT NULL ;\n\nALTER TABLE