D `usuario` VARCHAR(255) NOT NULL AFTER `vencimiento`, \nADD `id_origen` INT NOT NULL AFTER `usuario`, \nADD `impresa` BOOLEAN NOT NULL AFTER `id_origen`, \nADD `nueva` BOOLEAN NOT NULL AFTER `impresa`, \nADD `custom_6` VARCHAR(255) NOT NULL AFTER `nueva`, \nADD `custom_7` VARCHAR(255) NOT NULL AFTER `custom_6`, \nADD `custom_8` VARCHAR(255) NOT NULL AFTER `custom_7`, \nADD `custom_9` VARCHAR(255) NOT NULL AFTER `custom_8`, \nADD `custom_10` VARCHAR(255) NOT NULL AFTER `custom_9`, \nADD `numero_paso` INT NOT NULL AFTER `custom_10`, \nADD `forma_envio` VARCHAR(255) NOT NULL AFTER `numero_paso`, \nADD `coordinar_envio` INT NOT NULL AFTER `forma_envio`, \nADD INDEX `id_sucursal` (`id_sucursal`), \nADD INDEX `id_origen` (`id_origen`);\n\nUPDATE facturas F INNER JOIN puntos_venta PV ON (F.id_empresa = PV.id_empresa AND F.id_punto_venta = PV.id) INNER JOIN almacenes ALM ON (PV.id_empresa = ALM.id_empresa AND PV.id_sucursal = ALM.id) \nSET F.id_sucursal = ALM.id, F.sucursal = ALM.nombre, F.tipo_punto_venta = PV.tipo_impresion;\n\nUPDATE facturas F INNER JOIN vendedores V ON (F.id_empresa = V.id_empresa AND F.id_vendedor = V.id)\nSET F.vendedor = V.nombre;\n\nUPDATE facturas F INNER JOIN com_usuarios U ON (F.id_empresa = U.id_empresa AND F.id_usuario = U.id)\nSET F.usuario = U.nombre;\n\nUPDATE facturas F INNER JOIN clientes C ON (F.id_empresa = C.id_empresa AND F.id_cliente = C.id)\nSET F.cliente = C.nombre;\n\nUPDATE facturas F INNER JOIN empresas E ON (F.id_empresa = E.id)\nSET F.empresa = E.nombre;\n\nALTER TABLE `facturas` ADD INDEX `fecha` (`fecha`, `hora`, `numero`);\nALTER TABLE `facturas` ADD INDEX(`tipo`);\nALTER TABLE `facturas` ADD INDEX(`estado`);\nALTER TABLE `facturas` ADD INDEX(`anulada`);\n\nALTER TABLE `facturas` \nADD `costo_neto` DECIMAL(10,2) NOT NULL AFTER `coordinar_envio`,\nADD `costo_final` DECIMAL(10,2) NOT NULL AFTER `costo_neto`,\nADD `en_oferta` DECIMAL(10,2) NOT NULL AFTER `costo_final`;\n\nUPDATE facturas F SET costo_final = (SELECT SUM(FI.costo_final) FROM facturas_items FI WHERE F.id_empresa = FI.id_empresa AND F.id_punto_venta = FI.id_punto_venta AND F.id = FI.id_factura AND FI.anulado = 0)\nWHERE F.anulada = 0;\n\nUPDATE facturas F SET en_oferta = (SELECT SUM(FI.total_con_iva) FROM facturas_items FI WHERE F.id_empresa = FI.id_empresa AND F.id_punto_venta = FI.id_punto_venta AND F.id = FI.id_factura AND FI.anulado = 0 AND FI.custom_2 = \'1\')\nWHERE F.anulada = 0;\n\nUPDATE com_configuracion SET version_db = 310 WHERE id = 1;','',1),(311,'0000-00-00 00:00:00','ALTER TABLE `crm_emails_adjuntos` ADD INDEX(`tipo`);\r\nUPDATE com_configuracion SET version_db = 311 WHERE id = 1;','',1),(312,'0000-00-00 00:00:00','ALTER TABLE `facturas` DROP INDEX `fecha`, ADD INDEX `fecha` (`fecha`, `hora`) USING BTREE;\nALTER TABLE `facturas` ADD INDEX `id_empresa` (`id_empresa`) USING BTREE;\nALTER TABLE `facturas` ADD INDEX `id_punto_venta` (`id_punto_venta`) USING BTREE;\nUPDATE com_configuracion SET version_db = 312 WHERE id = 1;','',1),(313,'0000-00-00 00:00:00','INSERT INTO `com_modulos` (`id`, `dir`, `nombre`, `modulo_padre`, `etiqueta`, `orden`, `tiene_pantalla`, `clase`, `superadmin`, `valor`) VALUES (\'590\', \'estad\', \'estadisticas_articulos_web\', \'0\', \'Visitas de Articulos\', \'0\', \'1\', \'\', \'\', \'\');\nUPDATE com_configuracion SET version_db = 313 WHERE id = 1;','',1),(314,'0000-00-00 00:00:00','INSERT INTO `com_modulos` (`id`, `dir`, `nombre`, `modulo_padre`, `etiqueta`, `orden`, `tiene_pantalla`, `clase`, `superadmin`, `valor`) VALUES (\'2118\', \'pres\', \'pres_listado_reingreso\', \'0\', \'Reingresos\', \'0\', \'1\', \'\', \'\', \'\');\nUPDATE com_configuracion SET version_db = 314 WHERE id = 1;','',1),(315,'0000-00-00 00:00:00','ALTER TABLE `medios_pago_configuracion` ADD `habilitar_pago_sucursal` BOOLEAN NOT NULL;\nUPDATE medios_pago_configuracion SET habilitar_pago_sucursal = 1;\nUPDATE com_configuracion SET version_db = 315 WHERE id = 1;','',1),(316,'0000-00-00 00:00:00','ALTER TABLE `punt