INSERT INTO `web_servicios` VALUES (1,1,0,'Facturacin Electrnica AFIP','20150808121221_20150730111647_20150729231652_screenshot1.png','&lt;p&gt;Con Pymvar te ofrecemos Gestionar tu Empresa y generar&amp;nbsp;Facturas&amp;nbsp;Electr&amp;oacute;nicas aptas nuevo r&amp;eacute;gimen AFIP de con muy pocos clicks a un muy bajo costo.&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Crea tus facturas de forma simple y r&amp;aacute;pida.&lt;/li&gt;\r\n	&lt;li&gt;Facturas personalizadas con tu logo y colores.&lt;/li&gt;\r\n	&lt;li&gt;Imprimilas o envialas por email a tus clientes&amp;nbsp;en PDF.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n','/registro/'),(2,1,0,'Gestin Comercial','20150808121459_screen.png','&lt;p&gt;Gestion&amp;aacute; en pocos pasos elementos esenciales de tu negocio como el registro de ventas, compras, liquidaci&amp;oacute;n del IVA, stock de productos.&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Todo siempre disponibles en la nube con un s&amp;oacute;lo clic.&lt;/li&gt;\r\n	&lt;li&gt;Desde tu tel&amp;eacute;fono, tablet o computadora a tr&amp;aacute;ves de internet.&lt;/li&gt;\r\n	&lt;li&gt;Mayor seguridad antes perdidas, roturas o robo de tus datos.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n','/registro/'),(3,1,0,'Estadsticas','20150808121802_screen2.png','&lt;p&gt;Visualiz&amp;aacute; estad&amp;iacute;sticas de tus movimientos de venta, compra y cuentas corrientes asi como los productos m&amp;aacute;s vendidos y recib&amp;iacute; alertas en el faltante de stock de mercader&amp;iacute;a.&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Visualiz&amp;aacute; en tiempo real las compras y ventas realizadas.&lt;/li&gt;\r\n	&lt;li&gt;Indicadores de tu negocio de forma gr&amp;aacute;fica y simple.&lt;/li&gt;\r\n	&lt;li&gt;Monitore&amp;aacute; tu negocio en un solo vistazo.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n','/registro/'),(4,1,0,'Personalizacin','20150808123940_screen3.png','&lt;p&gt;Ofrecemos el servicio de instalaci&amp;oacute;n y personalizaci&amp;oacute;n del software a medida de las nececidades de tu negocio.&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Ahorr&amp;aacute; tiempo y costos usando Pymvar.&lt;/li&gt;\r\n	&lt;li&gt;Creamos los m&amp;oacute;dulo necesarios para facilitar tus tareas.&lt;/li&gt;\r\n	&lt;li&gt;Instala el sistema en tus servidores para usarlo sin limitaciones.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n','/registro/');
